INSERT INTO `dg_config_emails` (`id`, `label`, `message`) VALUES
(1, 'sub_register', 'Thank you for register!'),
(2, 'register', '<p>Dear {username}!</p>\n<p>Thank you register for tshirt</p>\n<p>Your Login ID: {email}</p>\n<p>&nbsp;</p>\n<p>Please <a href="{confirm_url}" target="_blank">Click here</a> to confirm account</p>\n<p>&nbsp;</p>\n<p>Regards,</p>\n<p>tshirtecommerce.com</p>\n<p>&nbsp;</p>'),
(3, 'sub_change_pass', 'Change pass !'),
(4, 'change_pass', '<p>Hi, {username}. Please have change password!</p>\n<p>Regards,</p>\n<p>tshirtecommerce.com</p>'),
(5, 'sub_forget_pass', 'Forgot password from tshirtecommerce.com'),
(6, 'forget_pass', '<p>Hello {username},</p>\n<p>&nbsp;</p>\n<p>You can login with the following credentials:</p>\n<p>&nbsp;username: {username}</p>\n<p>Please <a href="{confirm_url}" target="_blank">Click here</a> to change your password!</p>\n<p>&nbsp;</p>\n<p>Regards,</p>\n<p>tshirtecommerce.com</p>\n<p><strong>&nbsp;</strong></p>'),
(7, 'sub_save_design', ''),
(8, 'save_design', '<p>test {url_design}</p>\n<p>Regards,</p>\n<p>tshirtecommerce.com</p>'),
(9, 'sub_order_detai', ''),
(10, 'order_detai', '<p>Hi, {username}</p>\n<p>date: {date}</p>\n<p>total payment: {total}</p>\n<p>order number: {order_number}</p>\n<p>table: {table}</p>\n<p>Regards,</p>\n<p>tshirtecommerce.com</p>'),
(11, 'sub_order_status', 'Change Order status'),
(12, 'order_status', '<p>Hello {username},</p>\n<p>The status of your order number {order_number} is changed to {status}</p>\n<p>Regards,</p>\n<p>tshirtecommerce.com</p>');
