INSERT INTO `dg_products` (`id`, `title`, `slug`, `description`, `short_description`, `size`, `sku`, `layout`, `print_type`, `price`, `sale_price`, `image`, `gallery`, `min_order`, `max_oder`, `default`, `future`, `published`, `created`, `ordering`, `currency_id`, `params`, `meta_title`, `meta_keywords`, `meta_description`) VALUES
(1, 't-shirt', 't-shirt-sdf-asf', '<h1 style="box-sizing: border-box; margin: 0px 0px 20px; color: #747474; font-family: ''PT Sans'',Arial,Helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 22px; text-align: center; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; background-color: #ffffff;"><strong>H3 dfsdf sfsd</strong></h1>\n<h2 style="box-sizing: border-box; margin: 0px 0px 20px; color: #747474; font-family: ''PT Sans'', Arial, Helvetica, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 22px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;">The Short Military Jacket is based on an actual piece from the Barbour archive, customised by the original Department B for a pilot serving in the Falklands war. Originally a traditional country jacket, this heavily customised piece was tailored to meet the exact needs of a pilot within the parachute regiment with strategically placed reinforcements and a whole host of utilitarian pockets added to the jacket purely for practical purposes. Where he needed a pocket for ammunition, they added one. An incredible piece of design, the Short Military Jacket is evidence of the ethos of Dept. (B) and of Barbour as a whole, practicality is paramount and needs must.</h2>\n<ul class="fusion-checklist" style="box-sizing: border-box; list-style-type: none; padding: 0px; margin: 10px 0px 0px; color: #747474; font-family: ''PT Sans'', Arial, Helvetica, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 22px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;">\n<li class="fusion-li-item size-small" style="box-sizing: border-box; margin-bottom: 11px; font-size: 13px; line-height: 21px;">\n<div class="fusion-li-item-content" style="box-sizing: border-box; display: block; margin-left: 30px;">Cotton Construction</div>\n</li>\n<li class="fusion-li-item size-small" style="box-sizing: border-box; margin-bottom: 11px; font-size: 13px; line-height: 21px;">\n<div class="fusion-li-item-content" style="box-sizing: border-box; display: block; margin-left: 30px;">70/30 Acrylic/Wool Lining</div>\n</li>\n<li class="fusion-li-item size-small" style="box-sizing: border-box; margin-bottom: 11px; font-size: 13px; line-height: 21px;">\n<div class="fusion-li-item-content" style="box-sizing: border-box; display: block; margin-left: 30px;">Strategically Placed, Utilitarian Pockets</div>\n</li>\n<li class="fusion-li-item size-small" style="box-sizing: border-box; margin-bottom: 11px; font-size: 13px; line-height: 21px;">\n<div class="fusion-li-item-content" style="box-sizing: border-box; display: block; margin-left: 30px;">Reinforced Elbows</div>\n</li>\n<li class="fusion-li-item size-small" style="box-sizing: border-box; margin-bottom: 11px; font-size: 13px; line-height: 21px;">\n<div class="fusion-li-item-content" style="box-sizing: border-box; display: block; margin-left: 30px;">Vented Yoke</div>\n</li>\n<li class="fusion-li-item size-small" style="box-sizing: border-box; margin-bottom: 11px; font-size: 13px; line-height: 21px;">\n<div class="fusion-li-item-content" style="box-sizing: border-box; display: block; margin-left: 30px;"><strong>Original Functional Details</strong></div>\n</li>\n<li class="fusion-li-item size-small" style="box-sizing: border-box; margin-bottom: 11px; font-size: 13px; line-height: 21px;">\n<div class="fusion-li-item-content" style="box-sizing: border-box; display: block; margin-left: 30px;">Double Stud Placket</div>\n</li>\n<li class="fusion-li-item size-small" style="box-sizing: border-box; margin-bottom: 11px; font-size: 13px; line-height: 21px;">\n<div class="fusion-li-item-content" style="box-sizing: border-box; display: block; margin-left: 30px;">Adjustable Hood, Hem and Cuffs</div>\n</li>\n</ul>', 'The relaxed fit t-shirt for women has a narrow neck rib, tailored sleeves and a redesigned cut for a better ladies fit. With plenty of extra room, this shirt is ideal for most body types. The fabric is made from 100% pre-shrunk cotton (deep heather is 50% cotton/50%polyester) and has a fabric weight of 5.4 oz.', '<p><img src="media/assets/size,width130,height130.png" alt="" /></p>\n<table style="height: 99px;" width="581">\n<tbody>\n<tr>\n<td style="text-align: left;"><strong>&nbsp;Size</strong></td>\n<td style="text-align: center;"><strong>S</strong></td>\n<td style="text-align: center;"><strong>M</strong></td>\n<td style="text-align: center;"><strong>L</strong></td>\n<td style="text-align: center;"><strong>XL</strong></td>\n<td style="text-align: center;"><strong>XXL</strong></td>\n<td style="text-align: center;"><strong>XXXL</strong></td>\n</tr>\n<tr>\n<td><span style="color: #404040; font-family: ''Helvetica Neue'', Arial, Helvetica, Corbel, Calibri, ''Trebuchet MS'', sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: #ffffff;">&nbsp;Measure A (inch)</span></td>\n<td style="text-align: center;">&nbsp;<span style="color: #404040; font-family: ''Helvetica Neue'', Arial, Helvetica, Corbel, Calibri, ''Trebuchet MS'', sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: #ffffff;">24.5</span></td>\n<td style="text-align: center;">&nbsp;<span style="color: #404040; font-family: ''Helvetica Neue'', Arial, Helvetica, Corbel, Calibri, ''Trebuchet MS'', sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: #ffffff;">25.5</span></td>\n<td style="text-align: center;">&nbsp;<span style="color: #404040; font-family: ''Helvetica Neue'', Arial, Helvetica, Corbel, Calibri, ''Trebuchet MS'', sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: #ffffff;">26.5</span></td>\n<td style="text-align: center;">&nbsp;<span style="color: #404040; font-family: ''Helvetica Neue'', Arial, Helvetica, Corbel, Calibri, ''Trebuchet MS'', sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: #ffffff;">28.0</span></td>\n<td style="text-align: center;">&nbsp;<span style="color: #404040; font-family: ''Helvetica Neue'', Arial, Helvetica, Corbel, Calibri, ''Trebuchet MS'', sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: #ffffff;">28.7</span></td>\n<td style="text-align: center;">&nbsp;26.5</td>\n</tr>\n<tr>\n<td><span style="color: #404040; font-family: ''Helvetica Neue'', Arial, Helvetica, Corbel, Calibri, ''Trebuchet MS'', sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: #ffffff;">&nbsp;Measure B (inch)</span></td>\n<td style="text-align: center;">&nbsp;18.0</td>\n<td style="text-align: center;">&nbsp;20.0</td>\n<td style="text-align: center;">&nbsp;21.5</td>\n<td style="text-align: center;">&nbsp;24.0</td>\n<td style="text-align: center;">&nbsp;26.0</td>\n<td style="text-align: center;">&nbsp;28.0</td>\n</tr>\n</tbody>\n</table>', 'sadfds', 9, 'screen', 12, 10, 'media/assets/product-design/hooded-sweatshirt/front-hooded-sweatshirt-6.png', 'media/assets/product-design/hooded-sweatshirt/front-hooded-sweatshirt-6.png;media/assets/product-design/hooded-sweatshirt/back-hooded-sweatshirt-6.png;media/assets/product-design/hooded-sweatshirt/right-hooded-sweatshirt-6.png;media/assets/product-design/hooded-sweatshirt/left-hooded-sweatshirt-6.png', 1, 99, 0, '1', 1, '2015-01-10 11:31:51', 0, 144, '', 't-shirt', '', 'T-Shirt design software'),
(19, 'Phone case', 'phone-case', '<p><span style="font-family: ''Open+Sans'', sans-serif; font-size: 13px; line-height: 18.5714282989502px;">Product Description phone case</span></p>', 'Short Description', '<p>Product size info</p>\n<table style="height: 65px;" width="384">\n<tbody>\n<tr>\n<td style="text-align: center;"><strong>S</strong></td>\n<td style="text-align: center;"><strong>M</strong></td>\n<td style="text-align: center;"><strong>L</strong></td>\n<td style="text-align: center;"><strong>XL</strong></td>\n<td style="text-align: center;"><strong>XXL</strong></td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n<td>&nbsp;</td>\n<td>&nbsp;</td>\n<td>&nbsp;</td>\n<td>&nbsp;</td>\n</tr>\n</tbody>\n</table>', 'phone012', 0, 'sublimation', 10, 8, 'media/assets/product-design/iphone-case/case-black.png', '', 1, 999, 0, '1', 1, '2015-03-09 22:57:27', 0, 144, '', '', '', ''),
(5, 'iphone 5s case', 'iphone-5s-case', '<p class="gap_down" style="margin: 0px 0px 15px; padding: 0px; color: #404040; font-family: ''Helvetica Neue'', Arial, Helvetica, Corbel, Calibri, ''Trebuchet MS'', sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;">This form-fitting rubber cover for the iPhone 6 is a great way to add a little personality to your phone. Sleek and lightweight, this protective cover helps to avoid scratches, scuffs, chips and cracks, and can act as a good buffer should you accidentally drop your phone.</p>\n<ul class="listMCE" style="margin: 0px; padding: 0px; list-style: none; color: #404040; font-family: ''Helvetica Neue'', Arial, Helvetica, Corbel, Calibri, ''Trebuchet MS'', sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;">\n<li style="margin: 0px; padding: 0.2em 0px 0.2em 14px; background-image: url(''http://www.spreadshirt.com/Public/Common/img/list-bullet.png''); background-position: 0px 0.6em; background-repeat: no-repeat;">Made of flexible black rubber</li>\n<li style="margin: 0px; padding: 0.2em 0px 0.2em 14px; background-image: url(''http://www.spreadshirt.com/Public/Common/img/list-bullet.png''); background-position: 0px 0.6em; background-repeat: no-repeat;">Notched for cord connections, speakers, camera and volume toggles</li>\n<li style="margin: 0px; padding: 0.2em 0px 0.2em 14px; background-image: url(''http://www.spreadshirt.com/Public/Common/img/list-bullet.png''); background-position: 0px 0.6em; background-repeat: no-repeat;">Rubber button covers</li>\n<li style="margin: 0px; padding: 0.2em 0px 0.2em 14px; background-image: url(''http://www.spreadshirt.com/Public/Common/img/list-bullet.png''); background-position: 0px 0.6em; background-repeat: no-repeat;">PLEASE NOTE: We are not responsible for any damage that may occur to the phone. We recommend avoiding excessive bending to the phone case to prolong its life.</li>\n<li style="margin: 0px; padding: 0.2em 0px 0.2em 14px; background-image: url(''http://www.spreadshirt.com/Public/Common/img/list-bullet.png''); background-position: 0px 0.6em; background-repeat: no-repeat;">Imported; processed and printed in the U.S.A.</li>\n</ul>', 'This form-fitting rubber cover for the iPhone 6 is a great way to add a little personality to your phone. Sleek and lightweight, this protective cover helps to avoid scratches, scuffs, chips and cracks, and can act as a good buffer should you accidentally drop your phone.', '<table class="assort_sizes full_width">\n<thead>\n<tr><th>Size</th><th>One size</th></tr>\n</thead>\n<tbody>\n<tr>\n<td>Measure A (inch)</td>\n<td>5.5</td>\n</tr>\n<tr class="even">\n<td>Measure B (inch)</td>\n<td>2.5</td>\n</tr>\n</tbody>\n</table>', 'phone-case', 0, 'sublimation', 10, 0, 'media/assets/phone/iphone5-design11.png', '', 0, 0, 0, '0', 1, '2015-01-23 12:32:59', 0, 144, '', '', '', ''),
(6, 'Coffee/Tea Mug', 'coffee-tea-mug', '<p class="gap_down" style="margin: 0px 0px 15px; padding: 0px; color: #404040; font-family: ''Helvetica Neue'', Arial, Helvetica, Corbel, Calibri, ''Trebuchet MS'', sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;">This porcelain, fully-insulated mug is the perfect way to personalize your morning brew. Printable with graphics, photos or text, this handled mug is a great way to make your cup as unique as your coffee (cream and sugar not included).</p>\n<ul class="listMCE" style="margin: 0px; padding: 0px; list-style: none; color: #404040; font-family: ''Helvetica Neue'', Arial, Helvetica, Corbel, Calibri, ''Trebuchet MS'', sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;">\n<li style="margin: 0px; padding: 0.2em 0px 0.2em 14px; background-image: url(''http://www.spreadshirt.com/Public/Common/img/list-bullet.png''); background-position: 0px 0.6em; background-repeat: no-repeat;">Approximately 4&rdquo; tall and 3.3&rdquo; wide</li>\n<li style="margin: 0px; padding: 0.2em 0px 0.2em 14px; background-image: url(''http://www.spreadshirt.com/Public/Common/img/list-bullet.png''); background-position: 0px 0.6em; background-repeat: no-repeat;">Dishwasher safe</li>\n<li style="margin: 0px; padding: 0.2em 0px 0.2em 14px; background-image: url(''http://www.spreadshirt.com/Public/Common/img/list-bullet.png''); background-position: 0px 0.6em; background-repeat: no-repeat;">Imported; processed and printed in t